e host device, but present itself as a USB Mass Storage Device when connected to a host computer.','sunil@gmail.com','0777123456','PETROL','0777123456','12365','0777123456','0',0,0,882,'SONYERICCSON','BRANDNEW','OTG',NULL,'PUBLISH','OTG Cables','BUSINESS',NULL,'2016-06-23 11:56:39',1,2,4,'\0'),(389,'No 14/12, Akkarepattuwa.','ORIGINAL',NULL,'2016-06-23 11:56:38','USB On-The-Go, often abbreviated to USB OTG or just OTG, is a specification first used in late 2001 that allows USB devices, such as digital audio players or mobile phones, to act as a host, allowing other USB devices, such as USB flash drives, digital cameras, mice or keyboards, to be attached to them. Use of USB OTG allows those devices to switch back and forth between the roles of host and client. For instance, a mobile phone may read from removable media as the host device, but present itself as a USB Mass Storage Device when connected to a host computer.','sunil@gmail.com','0777123456','DIESEL','0777123456','8392','0777123456','-1',0,0,946,'SONYERICCSON','BRANDNEW','OTG',NULL,'PUBLISH','OTG Cables','PERSONEL',NULL,'2016-06-23 11:56:39',1,2,4,'\0'),(390,'No 14/12, Akkarepattuwa.','ORIGINAL',NULL,'2016-06-23 11:56:38','USB On-The-Go, often abbreviated to USB OTG or just OTG, is a specification first used in late 2001 that allows USB devices, such as digital audio players or mobile phones, to act as a host, allowing other USB devices, such as USB flash drives, digital cameras, mice or keyboards, to be attached to them. Use of USB OTG allows those devices to switch back and forth between the roles of host and client. For instance, a mobile phone may read from removable media as the host device, but present itself as a USB Mass Storage Device when connected to a host computer.','sunil@gmail.com','0777123456','DIESEL','0777123456','9401','0777123456','-5',0,0,1400,'SONYERICCSON','BRANDNEW','OTG',NULL,'PUBLISH','OTG Cables','BUSINESS',NULL,'2016-06-23 11:56:39',1,2,4,'\0'),(391,'No 14/12, Akkarepattuwa.','ORI